  input: TEXT,F3XA,,"This memo is in response to the preliminary review of the Club
    for Growth Inc. PAC's mid year report (1/1/01-6/30/01).  The Kennedy for Congress
    contribution found on schedule B, originally entered as debt reduction, has been
    amended to 'Primary 2002'.  It appears that due to a typing error the contribution
    was inadvertantly enterered on the report as debt reduction.  Also, we have amended
    Schedule B to identify the earmarked receipts and disbursements in the manner
    suggested in your letter.  As this was our first report using FEC File4 electronic
    filing softwarre, we were not familiar with the proper data entry procedure for
    reporting earmarked receipts and disbursements, and apparently had a miscommunication
    with FEC support when we inquired about this procedure.  We believe these amendments
    should satisfy the issues raised by the preliminary review."
